import React from 'react';

class Index extends React.Component {
    render(){
        return(
            <React.Fragment>
                <h1>I am from Index Page!</h1>
                <a href="/">Home</a>
                <a href="/about">About</a>
                <a href="/blogs">Blog</a>
                <a href="/portfolios">Portfolio</a>
                
                <a href="/cv">CV</a>
            </React.Fragment>
        );
    }
}

export default Index;
